

export default class WidgetObject
{
  constructor()
  { 
  }

  // Garph
  WidgetGraphObject(id, canvasTag, chartData, chartOption, type, serviceList)
  {
    this.id = id;
    this.canvasTag = canvasTag;
    this.chartData = chartData;
    this.chartOption = chartOption;
    this.type = type;
    this.serviceList = serviceList;
  }

  // Text
  MapWidgetObject(id, mapTag, type)
  {
    this.id = id;
    this.mapTag = mapTag;
    this.type = type;
  }

  // Text
  HeadFontObject(id, spanTag, type)
  {
    this.id = id;
    this.spanTag = spanTag;
    this.type = type;
  }

  // Table
  WidgetTableObject(id, tableTag, type, serviceList)
  {
    this.id = id;
    this.tableTag = tableTag;
    this.type = type;
    this.serviceList = serviceList;
  }

  // Image
  WidgetImageObject(id, divImgTag, type, path)
  {
    this.id = id;
    this.divImgTag = divImgTag;
    this.type = type;
    this.path = path;
  }

  // Shape
  WidgetShapeObject(id, divTag, type)
  {
    this.id = id;
    this.divTag = divTag;
    this.type = type;
  }
}